import React, { useState, useEffect } from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import UploadImages from "./components/upload";
import ImageAnnotation from "./components/imageannotation";
import ImageTable from "./components/list";
import ModelsTable from './components/modellist';
import RuleCreationPage from "./components/createrule";
import Layout from './components/Layout';
import TableComponent from './components/viewrules';
import DeploymentTable from './components/viewdeploy';

const PrivateRoute = ({ path, element: Component }) => {
  const [isValidUser, setIsValidUser] = useState(false);

  useEffect(() => {
    const userEmail = localStorage.getItem('userEmail');
    // Add your authentication logic here to check if the userEmail is valid
    setIsValidUser(userEmail !== null && userEmail !== '');
    console.log(userEmail);
    console.log(isValidUser);
  }, []);

  return isValidUser ? (
    <Route path={path} element={<Component />} />
  ) : (
    <Navigate to="/login" replace />
  );
};

const AuthenticatedApp = () => {
  return (
    <>
      <Route path="/" element={<Layout />} />
      <Route path="/imageannotation/:requestID" element={<ImageAnnotation />} />
      <Route path="dataset/view" element={<ImageTable />} />
      <Route path="dataset/upload" element={<UploadImages />} />
      <Route path="model/view" element={<ModelsTable />} />
      <Route path="model/train" element={<ImageTable />} />
      <Route path="rules/create" element={<RuleCreationPage />} />
      <Route path="rules/view" element={<TableComponent />} />
      <Route path="deploy" element={<DeploymentTable />} />
    </>
  );
};

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="login" element={<Login />} />
        <Route path="register" element={<Register />} />
        <Route
          path="/"
          element={
            <PrivateRoute path="/" element={<AuthenticatedApp />} />
          }
        />
      </Routes>
    </Router>
  );
};

ReactDOM.render(<App />, document.getElementById('root'));
